import '../App.css';
import cheetah from '../images/cheetah.jpeg';
import animals from '../images/animals.jpeg';
import bats from '../images/bats.jpeg';


const App = () => {
  return (
    <div className="container">
        <div class="header">
          <h1>CSS FLEXBOX PHOTO GALLERY</h1>
        </div>
        <div id="gallery">
          <img src={cheetah}/>
          <img src={animals} />
          <img src={bats} />

        </div>
    </div>
  )
}

export default App;
